import React from 'react';
import { motion } from 'framer-motion';
import SlackWorkspaceMockup from './SlackWorkspaceMockup'; // Import the Slack Component

// Simple connector line component
const ConnectorLine = ({ from, to }) => (
  <svg className="absolute" style={{ top: from.top, left: from.left }}>
    <line
      x1="0"
      y1="0"
      x2={to.x}
      y2={to.y}
      stroke="#D1D5DB"
      strokeWidth="2"
      markerEnd="url(#arrowhead)"
    />
    <defs>
      <marker id="arrowhead" markerWidth="6" markerHeight="6" refX="5" refY="3" orient="auto">
        <path d="M0,0 L0,6 L6,3 z" fill="#D1D5DB" />
      </marker>
    </defs>
  </svg>
);

function HowRelamWorks() {
  const sources = [
    { icon: '📊', label: 'Property Data' },
    { icon: '🌐', label: 'Web Signals' },
    { icon: '🧑‍💼', label: 'Customer Lists' },
    { icon: '📄', label: 'Internal Docs' },
  ];

  return (
    <section id="how-it-works" className="py-32 px-6 relative bg-white overflow-hidden">
      <div className="max-w-7xl mx-auto text-center">

        {/* Section Title */}
        <h2 className="text-4xl font-bold mb-20 text-[#111827]">How Relam.ai Works</h2>

        {/* Sources */}
        <div className="relative flex flex-wrap justify-center gap-16 mb-24">
          {sources.map((source, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, scale: 0.9, y: 30 }}
              whileInView={{ opacity: 1, scale: 1, y: 0 }}
              viewport={{ once: true }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              className="flex flex-col items-center relative"
            >
              <div className="text-4xl bg-[#f1f5fb] w-14 h-14 flex items-center justify-center rounded-full shadow-md mb-2 hover:shadow-lg hover:bg-[#eef2ff] transition-all text-3xl">
                {source.icon}
              </div>
              <p className="text-[#4b5563] text-sm font-semibold">{source.label}</p>
            </motion.div>
          ))}

          {/* Multi-line connectors */}
          <div className="hidden md:block absolute top-[120px] left-1/2 transform -translate-x-1/2">
            <svg width="300" height="100" viewBox="0 0 300 100" fill="none" xmlns="http://www.w3.org/2000/svg">
              <line x1="150" y1="0" x2="150" y2="50" stroke="#D1D5DB" strokeWidth="2" />
              <line x1="50" y1="50" x2="250" y2="50" stroke="#D1D5DB" strokeWidth="2" />
              <line x1="50" y1="50" x2="50" y2="70" stroke="#D1D5DB" strokeWidth="2" />
              <line x1="150" y1="50" x2="150" y2="70" stroke="#D1D5DB" strokeWidth="2" />
              <line x1="250" y1="50" x2="250" y2="70" stroke="#D1D5DB" strokeWidth="2" />
            </svg>
          </div>
        </div>

        {/* Best-in-Class Section */}
        <motion.div
          initial={{ opacity: 0, scale: 0.9, y: 30 }}
          whileInView={{ opacity: 1, scale: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.7, ease: 'easeOut' }}
          className="bg-white p-10 rounded-2xl shadow-xl border border-[#e0e7ff] max-w-4xl mx-auto mb-24"
        >
          <h3 className="text-2xl font-bold text-[#111827] mb-6">
            Best-in-class AI and Computational Frameworks
          </h3>
          <hr className="border-[#e0e7ff] my-6" />

          <div className="flex flex-col gap-8 text-left">
            <div className="flex items-center gap-5">
              <div className="bg-[#f1f5fb] p-3 rounded-full">
                <svg className="w-6 h-6 text-blue-600" fill="currentColor" viewBox="0 0 20 20"><path d="M10 2a8 8 0 00-8 8v4.586l-1.707 1.707a1 1 0 001.414 1.414l2.121-2.121A8.001 8.001 0 0010 18a8 8 0 000-16zm-1 8V4h2v6h-2zm1 8a6 6 0 110-12 6 6 0 010 12z" /></svg>
              </div>
              <div>
                <p className="text-lg font-bold text-[#111827]">96% Signal Accuracy</p>
                <p className="text-sm text-[#6b7280]">Validated across diverse proprietary datasets</p>
              </div>
            </div>

            <div className="flex items-center gap-5">
              <div className="bg-[#f1f5fb] p-3 rounded-full">
                <svg className="w-6 h-6 text-green-600" fill="currentColor" viewBox="0 0 20 20"><path d="M5 13l4 4L19 7" /></svg>
              </div>
              <div>
                <p className="text-lg font-bold text-[#111827]">90% Noise Reduction</p>
                <p className="text-sm text-[#6b7280]">Using proprietary computational frameworks</p>
              </div>
            </div>

            <div className="flex items-center gap-5">
              <div className="bg-[#f1f5fb] p-3 rounded-full">
                <svg className="w-6 h-6 text-purple-600" fill="currentColor" viewBox="0 0 20 20"><path d="M10 2a8 8 0 018 8v6a2 2 0 01-2 2h-2v-2h2V10a6 6 0 00-12 0v6h2v2H4a2 2 0 01-2-2v-6a8 8 0 018-8z" /></svg>
              </div>
              <div>
                <p className="text-lg font-bold text-[#111827]">Enterprise-Grade Scalability</p>
                <p className="text-sm text-[#6b7280]">Designed for Fortune 500 operational environments</p>
              </div>
            </div>
          </div>
        </motion.div>

        {/* Slack Title */}
        <motion.h3
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.7 }}
          className="text-3xl font-bold text-[#111827] mb-10"
        >
          Contextual Insights Delivered to Slack
        </motion.h3>

        {/* Slack Workspace Mockup */}
        <SlackWorkspaceMockup />

      </div>
    </section>
  );
}

export default HowRelamWorks;
